import React, {useState, useEffect} from 'react'
import { Link, useHistory } from 'react-router-dom'

const ManagerMain = () => {
    const history = useHistory()

    const logOut = () => {
        localStorage.removeItem('accessToken')
        history.replace('/')
    }
    
    return(
        <div>
            This is manager user
        </div>
    )
}

export default ManagerMain
